Blelll blello evwybody!! We just want to thank everyone so much for participating in the #tinychefandme art challenge. Cheffy received so many incredible artworks in so many different forms and as you can probably imagine he’s spent all week looking/reading and admiring them and in general just going completely bananas about them. .
.
The tiny team put together this little montage of SOME of the entries. The Chef has been singing along to this Tiny Chef And Me song by Ingrid Smallman ALL WEEK so we thought Chef singing along to this beautiful song made the perfect musical backdrop. To see more gorgeous Chef adventure artwork look up the #tinychefandme hashtag!! ❤️❤️❤️❤️
